import os
import base64
import binascii
from PyPDF2 import PdfReader

def base64_to_pdf(base64_str, output_path, verify_pdf=True):
    """
    将Base64字符串转换为PDF文件
    
    :param base64_str: 包含PDF内容的Base64编码字符串
    :param output_path: 输出PDF文件路径
    :param verify_pdf: 是否验证生成的文件有效性
    :return: True表示转换成功
    """
    try:
        # 清理可能的头信息（如："data:application/pdf;base64,"）
        if ";base64," in base64_str:
            base64_str = base64_str.split(";base64,")[1]

        # Base64解码
        pdf_bytes = base64.b64decode(base64_str, validate=True)
        
        # 写入文件
        with open(output_path, "wb") as f:
            f.write(pdf_bytes)
        
        # 可选验证
        if verify_pdf:
            try:
                with open(output_path, "rb") as f:
                    PdfReader(f)
                print(f"验证成功：{output_path} 是有效的PDF文件")
            except Exception as e:
                raise ValueError(f"生成的文件不是有效PDF: {str(e)}")
        
        return True
    
    except binascii.Error as e:
        raise ValueError(f"Base64解码失败: {str(e)}")
    except IOError as e:
        raise ValueError(f"文件写入失败: {str(e)}")

# 使用示例
if __name__ == "__main__":
    # 示例Base64字符串（已截断，实际应包含完整PDF内容）
    sample_base64 = (
        ""
    )

    output_path = "64output.pdf"
    
    try:
        success = base64_to_pdf(sample_base64, output_path)
        if success:
            print(f"文件已保存到：{os.path.abspath(output_path)}")
    except ValueError as e:
        print(f"转换失败：{str(e)}")